import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
import { useState } from 'react';

const emptyclass = () => {
    const navigate = useNavigate();
    const [activeBuilding, setActiveBuilding] = useState(null);

    function emptyHandler() {
        navigate("/home/")
    }
    const handleBuildingClick = (buildingId) => setActiveBuilding(buildingId);
    axios({
        method: "get",
        url: '/api/empty_room',
        headers: {
            "Content-Type": 'application/form-data',
            "traefik": "jwzx",
        },
    }).then(res => {
        console.log(res);
    }, err => {
        console.log(err)
    });
    const Building = ({ id }) => (
        <div className="emptychoice" id={id}>
            {[...Array(id === 'build5' ? 4 : id === 'build8' ? 2 : 5).keys()].map(i => (
                <div className="floordiv" id={`f${i + 1}div`}>
                    <img src={require(`./emptypic/${i + 1}f.jpg`)} id={`f${i + 1}`} className="buildingpic" />
                </div>
            ))}
        </div>
    );

    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            {activeBuilding && <Building id={activeBuilding} />}
            <div id="classchoice">
                <div id="building">
                    {['build2', 'build3', 'build4', 'build5', 'build8'].map(building => (
                        <div className="buildingbtndiv">
                            <button id={`btn${building}`} className="buildingbtn" onClick={() => handleBuildingClick(building)}>
                                {building.replace('build', '')}教
                            </button>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    )
}
export default emptyclass;
